import { Component, OnInit } from '@angular/core';
import { MAT_FORM_FIELD_DEFAULT_OPTIONS } from '@angular/material/form-field';
import { IntegralService } from 'src/app/services/integral.service';

interface Button {
  text: string;
  color?: 'primary' | 'accent' | 'warn' | string;
}

  @Component({
    selector: 'app-calculator',
    templateUrl: './calculator.component.html',
    styleUrls: ['./calculator.component.css'],

  })

export class CalculatorComponent implements OnInit {
cls() {
  this.inputValue =''
}
  inputValue: string = ''; // Variable que almacena el valor del campo de entrada
  color?: 'primary' | 'accent' | 'warn' | string;

  buttons: Button[][] = [
    [{ text: '1' }, { text: '2' }, { text: '3' }, { text: '+', color: 'accent' }, { text: '-', color: 'accent' }],
    [{ text: '4' }, { text: '5' }, { text: '6' }, { text: '*', color: 'accent' }, { text: '/', color: 'accent' }],
    [{ text: '7' }, { text: '8' }, { text: '9' }, { text: '^', color: 'accent' }, { text: '{a}^{b}', color: 'accent' }],
    [{ text: 'nth_root()', color: 'accent' }, { text: 'e' }, { text: 'pi' }, { text: 'sqrt', color: 'accent' }, { text: 'log10', color: 'accent' }],
  ];


  constructor(private intetegralService:IntegralService) { }


  ngOnInit() {
  }
  buttonClick(button: { text: string }) {
    this.inputValue += button.text; 

    console.log(`Clicked: ${button.text}`);
  }
  calculate(){
    /*this.intetegralService.save().subscribe(()=>{

    })*/
  }



}


<div class="data">
  <input type="text" [value]="inputValue" readonly class="input-field"/>
  <input type="text" [value]="inputValue" readonly class="input-field"/>
</div>
<div class="example-container">
  <mat-form-field hintLabel="Max 10 characters">
    <mat-label>Enter some input</mat-label>
    <input matInput #input maxlength="10" placeholder="Ex. Nougat">
    <mat-hint align="end">{{input.value.length}}/10</mat-hint>
  </mat-form-field>

  <mat-form-field>
    <mat-label>Select me</mat-label>
    <mat-select>
      <mat-option value="option">Option</mat-option>
    </mat-select>
    <mat-hint align="end">Here's the dropdown arrow ^</mat-hint>
  </mat-form-field>
</div>
<div class="container">
  <div class="button-grid">
    <ng-container *ngFor="let row of buttons">
      <div class="row">
        <ng-container *ngFor="let button of row">
          <button mat-fab  color="warn" matTooltip="Acent" (click)="buttonClick(button)" class="button-item">
            {{ button.text }}
          </button>
        </ng-container>
      </div>
    </ng-container>
  </div>
  <div class="actions">

    <button style="color: brown;
    height: 100px;
    width: 100px;"> calcular</button>
        <button style="color: brown;
        height: 100px;
        width: 100px;" (click)="cls()"> limpiar</button>

  </div>
</div>
